import React from 'react'

let countMorn = 0;
let countEven = 0;
let countAfter = 0;
let countNi = 0;

export default class DownloadTime extends React.Component{
    constructor(props)
    {
        super(props);

        this.state = {
           countMorning: 0,
           countAfternoon: 0,
           countEvening: 0,
           countNight: 0
        };
    }
    
    componentDidMount()
    {
        this.props.data.downloads.map( d =>
            {
                if((Date.parse(d.downloaded_at) >= Date.parse('06:00:00'))&&(Date.parse(d.downloaded_at) <= Date.parse('12:00:00')))
                {countMorn = countMorn +1;} // Downloads in the MORNING
                else if((Date.parse(d.downloaded_at) > Date.parse('12:00:00'))&&(Date.parse(d.downloaded_at) <= Date.parse('18:00:00')))
                {countAfter = countAfter + 1;}// Downloads in the AFTERNOON
                else if ((Date.parse(d.downloaded_at) > Date.parse('18:00:00'))&&(Date.parse(d.downloaded_at) <= Date.parse('22:00:00')))
                {countEven = countEven + 1;} // Downloads in the EVENING
                else if ((Date.parse(d.downloaded_at) > Date.parse('22:00:00'))&&(Date.parse(d.downloaded_at) <= Date.parse('06:00:00')))
                {countNi = countNi + 1;} // Downloads at NIGHT
            })

        this.setState({countMorning: countMorn, countAfternoon: countAfter, countEvening: countEven, countNight: countNi});
    }

    render()
    {
        
    console.log(Date.parse(this.props.data.downloads[1]) > Date.parse('12:00:00') > true);

        return(
            <table  className="table table-striped table-bordered table-sm">
            <thead>
            <tr>
                <th scope="col">#</th>
                <th scope="col">Morning</th>
                <th scope="col">Afternoon</th>
                <th scope="col">Evening</th>
                <th scope="col">Night</th>
            </tr>
            </thead>
            <tbody>
                <tr>
                    <th scope="row">Downloads</th>
                    <td>{this.state.countMorning}</td>
                    <td>{this.state.countAfternoon}</td>
                    <td>{this.state.countEvening}</td>
                    <td>{this.state.countNight}</td>
                </tr>
            </tbody>
            </table>
        )
    }
}
